import React from 'react';
import './SideMenu.css';

const SideMenu = ({ isActive, onClose }) => {
  return (
    <div className={`side-menu ${isActive ? 'active' : ''}`}>
      <div className="side-menu-header">
        <button className="close-btn" onClick={onClose}>
          <span className="close-icon">&#10005;</span>
          <span className="close-text">LOCATIONS</span>
        </button>
      </div>
      
      <div className="logo-container">
        <div className="side-logo">K</div>
      </div>
      
      <nav className="side-nav">
        <ul>
          <li><a href="/" className="nav-main">HOME</a></li>
          <li><a href="#about" className="nav-main">ABOUT</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default SideMenu;
